import React from 'react'

const ShowWorkout = ({ workouts }) => {
    return (
        <div className="row">
            {workouts.map(workout => (
                <div key={workout._id}  className="col-lg-3 col-sm-6">
                    <div className="card wo-card">
                        <img className="card-img-top" src={workout.picture.url} alt={workout.name} />
                        <div className="card-body">
                            <h5 className="card-title">{workout.name}</h5>
                            <a href={`/workout/${workout._id}`} className="btn wo-sm-btn workout-btn">See More</a>
                        </div>
                    </div>
                </div>
            ))}
        </div>
    )
}

export default ShowWorkout
